-- Seed Supermarkets
-- Source: OpenStreetMap Overpass API
-- Generated: 2025-12-06

-- First, ensure the Supermarkets layer exists
SELECT 'Supermarkets', 'Супермаркети', 'supermarket', 'store', '#4CAF50'
WHERE NOT EXISTS (SELECT 1 FROM poi_layers WHERE name = 'Supermarkets');

DO $$
DECLARE
    super_layer_id UUID;
    kyiv_id UUID;
    lviv_id UUID;
    kharkiv_id UUID;
    odesa_id UUID;
    dnipro_id UUID;
BEGIN
    SELECT id INTO super_layer_id FROM poi_layers WHERE name = 'Supermarkets' LIMIT 1;

    -- Verify layer exists
    IF super_layer_id IS NULL THEN
        RAISE EXCEPTION 'Supermarkets layer not found in poi_layers table';
    END IF;

    SELECT id INTO kyiv_id FROM cities WHERE name = 'Kyiv' LIMIT 1;
    SELECT id INTO lviv_id FROM cities WHERE name = 'Lviv' LIMIT 1;
    SELECT id INTO kharkiv_id FROM cities WHERE name = 'Kharkiv' LIMIT 1;
    SELECT id INTO odesa_id FROM cities WHERE name = 'Odesa' LIMIT 1;
    SELECT id INTO dnipro_id FROM cities WHERE name = 'Dnipro' LIMIT 1;

    ON CONFLICT DO NOTHING;

    RAISE NOTICE 'Inserted supermarkets';
END $$;